void DummySourceObjects::create()
{

    //SIFDummy.mKind = FileKind::DUMMY;
    SFdummy = new SourceFile(FileKind::SPRITE_SHEET_IMAGE);
    SFdummy->saveID = cons::saveID_DUMMY_SIF;

    dummyImage = new EmbeddedSourceDummyImage();

#ifdef JUGI_EDITOR
    SFdummy->mPixmap = jugi::base::TPixmap::fromByteArray(dummyImage->width,dummyImage->height,jugi::base::TPixmap::PF_RGBA8888, dummyImage->data);
    //SIFDummy->Pixmap->Save("sourceDummiesSaved.png");
    //SIFDummy->ImageAtlas = new jugi::openGL::Image(SIFDummy->Pixmap, jugi::glob::mapImagesTextureFlag);
    SFdummy->mTexture = new ncine::Texture();
    SFdummy->mTexture->init(buffName.c_str(), ncine::Texture::Format::RGBA8, dummyImage->width, dummyImage->height);
    bool ok = SFdummy->mTexture->loadFromTexels(dummyImage->data);
    assert(SFdummy->mTexture->dataSize()>0);

#else
    SFdummy->mTexture = new ncine::Texture();
    SFdummy->mTexture->init(buffName.c_str(), ncine::Texture::Format::RGBA8, dummyImage->width, dummyImage->height);
    bool ok = SFdummy->mTexture->loadFromTexels(dummyImage->data);
    assert(SFdummy->mTexture->dataSize()>0);
#endif

    SFdummy->mTexture->setMagFiltering(ncine::Texture::Filtering::NEAREST);
    SFdummy->mTexture->setMinFiltering(ncine::Texture::Filtering::LINEAR);

    //-----
    SImissingTexture = SFdummy->AddSourceImage("missingTextureDummy", 0, 0, 0, 0);
    SImissingTexture->saveID = cons::saveID_DUMMY_MISSING_TEXTURE;


    //-----
    SImissingSourceSprite = SFdummy->AddSourceImage("missingSourceSpriteDummy", 0, 0, 0, 0);
    SImissingSourceSprite->saveID = cons::saveID_DUMMY_MISSING_SOURCE_SPRITE;

    SSmissingSourceSprite = new SourceSprite(SpriteType::STANDARD);
    SSmissingSourceSprite->mName = "missingSourceSpriteDummy";
    SSmissingSourceSprite->sourceImages().push_back(SImissingSourceSprite);
#ifdef JUGI_EDITOR
    SSmissingSourceSprite->mMarkerImage = SImissingSourceSprite;
#endif
    SSmissingSourceSprite->saveID = cons::saveID_DUMMY_MISSING_SOURCE_SPRITE;


    //-----
    SIemptyFrame = SFdummy->AddSourceImage("emptyFrameDummy", 0, 0, 0, 0);
    SIemptyFrame->saveID = cons::saveID_DUMMY_EMPTY_FRAME;

    //-----
    SIcompositeSpriteSourceImage = SFdummy->AddSourceImage("compositeSpriteSourceImageDummy", 0, 0, 0, 0);
    SIcompositeSpriteSourceImage->saveID = cons::saveID_COMPOSITE_SPRITE_SOURCE_IMAGE_DUMMY;

    //-----
    SIdummyChildForEmptyCompositeSprite = SFdummy->AddSourceImage("emptyCompositeSpriteDummy", 0, 0, 0, 0);
    SIdummyChildForEmptyCompositeSprite->saveID = cons::saveID_DUMMY_EMPTY_COMPOSED_SPRITE;
    SIdummyChildForEmptyCompositeSprite->mHandle.set(0,0);

    SSdummyChildForEmptyCompositeSprite = new SourceSprite(SpriteType::STANDARD);
    SSdummyChildForEmptyCompositeSprite->mName = SIdummyChildForEmptyCompositeSprite->mName;
    SSdummyChildForEmptyCompositeSprite->sourceImages().push_back(SIdummyChildForEmptyCompositeSprite);
#ifdef JUGI_EDITOR
    SSdummyChildForEmptyCompositeSprite->mMarkerImage = SIdummyChildForEmptyCompositeSprite;
#endif
    SSdummyChildForEmptyCompositeSprite->saveID = cons::saveID_DUMMY_EMPTY_COMPOSED_SPRITE;

#ifdef JUGI_EDITOR
    SdummyChildForEmptyCompositeSprite = new StandardSprite();
    SdummyChildForEmptyCompositeSprite->_setSourceSprite(SSdummyChildForEmptyCompositeSprite);
#endif


    //-----
    SStextSourceSprite = new SourceSprite(SpriteType::TEXT);
    SStextSourceSprite->mName = "textSourceSpriteDummy";
    SStextSourceSprite->saveID = cons::saveID_DUMMY_SIF_TEXT_SPRITE;


    //-----
    updateSourceImagesForDefinedSize();

}


void DummySourceObjects::updateSourceImagesForDefinedSize()
{

    if(!(imageSize==16 || imageSize==24 || imageSize==32 || imageSize==48)){
        imageSize = 32;
    }

    // dimensions of subimages inside SIFDummy sprite sheet image
    int xPos = 0;
    int yStep = 48;

    if(imageSize==16){
        xPos = 104;
    }else if(imageSize==24){
        xPos = 80;
    }else if(imageSize==32){
        xPos = 48;
    }else if(imageSize==48){
        xPos = 0;
    }

    SImissingTexture->mRect.set(xPos, 0*yStep, xPos+imageSize, 0*yStep+imageSize);
    SImissingSourceSprite->mRect = SImissingTexture->mRect;
    SIemptyFrame->mRect.set(xPos, 1*yStep, xPos+imageSize, 1*yStep+imageSize);
    SIemptyFrame->mHandle.set(imageSize/2.0f, imageSize/2.0f);
    SIdummyChildForEmptyCompositeSprite->mRect.set(xPos, 2*yStep, xPos+imageSize, 2*yStep+imageSize);
    //SIComposedSpriteDummy->mRect.set(xPos, 3*yStep, xPos+imageSize, 3*yStep+imageSize);

    //---
    //SIFDummy->DeleteExternalData();
    //SIFDummy->LoadExternalData();
    for(SourceImage* si : SFdummy->mSourceImages){
        si->DeleteExternalData();
        si->LoadExternalData();
    }
}


void DummySourceObjects::deleteContent()
{
    delete SFdummy;
    delete SSdummyChildForEmptyCompositeSprite;
    delete SdummyChildForEmptyCompositeSprite;
    delete SStextSourceSprite;
    delete SSmissingSourceSprite;
    delete dummyImage;

}



